import DragDrop  from '../utils/DragDrop.js';
import { fixture } from '../test/fixture.js';
import styled from "styled-components";
// const apiUrl = "https://run.mocky.io/v3/cbca762d-3f84-4ae4-bb26-79fa774a6c72";
const apiUrl = "";


const Button = styled.button`
    color:  #5FA772;
   font-family: Calibri,

`;


const HomePage = () => {

    const [content,setContent]=useState([])
    const [file,setFile]=useState('')

    const data = fixture;//fileUpload;
    console.log(data);


    const handleSubmit = async () => {
        try {
            const result = await fetch(apiUrl, {
                method: 'POST',
                headers: {
                    'Content-Type': 'application/json'
                },
                body: JSON.stringify(data)
            });

            if (result.ok) {
                console.log(result);
            } else {
                throw new Error();
            }
        } catch (e) {
            console.log(e);
        }
    };



    return (
		<>
			<div className="row">
				<div>
					<h4></h4>
                    <div style={{alignItems:"center",alignSelf:"center",textAlign:"center"}}>
          <label>
            Select the CSV File 
          </label>
          <input type="file" value={file} accept={".csv,.xls, .xlsx"} onChange={(event)=>setFile(event.target.value)}/><br />
          <button onClick={handleSubmit}>Submit</button>
        </div>
				</div>
			</div>

		</>
	)
};

export default HomePage;
